pragma solidity >= 0.4.22;

import "./reportfactory.sol";

contract ReportHelper is ReportFactory{
    
    function giveReportingAccess(address _reporter) external onlyOwner{
        reporterToVerified[_reporter] = true;
    }
    
    function updateStatus(uint _reportId, uint _newStatus) external{
        require(msg.sender == reportToReporter[_reportId]);
        
        Report storage report = reports[_reportId];
        
        require(Status(_newStatus) != report.status);
        
        statusToCount[uint(report.status)]--;

        report.status = Status(_newStatus);
    
        statusToCount[_newStatus]++;
    }

    function getCountryCases(string calldata _location) external view returns(uint) {
        return (countryToReports[_location].length);
    }
    
    function getReport(uint _reportId) external view returns(uint, address, string memory, string memory, Status){
        return(reports[_reportId].localPatientId, reports[_reportId].reporter, reports[_reportId].firstReport_hash, reports[_reportId].location, reports[_reportId].status);
    }
    
    function getReport(uint _status, uint _reportId) external view returns(int, address, string memory, string memory, Status){
        if(uint(reports[_reportId].status) == _status){
            return(int(reports[_reportId].localPatientId),reports[_reportId].reporter, reports[_reportId].firstReport_hash, reports[_reportId].location, reports[_reportId].status);
        }
        else{
            return(-1,reports[_reportId].reporter, reports[_reportId].firstReport_hash, reports[_reportId].location, reports[_reportId].status);
        }
    }

    function getLastReportId() external view returns(uint){
        return reporterToReports[msg.sender].length - 1;
    }
    
    function getRecord(uint _reportId, uint _recordIndex) external view returns(string memory){
        return(reports[_reportId].records_hash[_recordIndex]);
    }

    function getRecordsLength(uint _reportId) external view returns(uint){
        return(reports[_reportId].records_hash.length);
    }
}
